import React from "react";
import Athlete from "./Athlete";

App.defaultProps = {data}

const prdataops = {
    "Name": "Athlete-Name",
    "Date": "Date",
    "averageScore": {
        "Monday": "dataMonday",
        "Tuesday": "dataTuesday",
        "Wednesday": "dataWednesday",
        "Thursday": "dataThursday",
        "Friday": "dataFriday",
        "Saturday": "dataSaturday",
        "Sunday": "dataSunday"
    },
    "weeklyAverage": 0
}

function App(){
    return(
    <div>
        <Athlete props={props}/>
    </div>
    )
}

export default App;
